var changeCoolformWrappers, synchronizeCoolform, initCoolform;

/*! Coolform */
(function( $ ){
    var plugin_class = '.coolform';

    $.fn.refresh = function() {
        // Убираем выделение с группы радио
        if( this.is('[type=radio]') )
            $(plugin_class + '.radio input[name="'+ this.attr('name') +'"]').each(function(){
                $(this).parent(plugin_class).removeClass('active');
            });

        // Проставляем классы обновляемому элементу
        if (this.is(':checked'))
            this.parent(plugin_class).addClass('active');
        else
            this.parent(plugin_class).removeClass('active');

        if (this.is(':disabled'))
            this.parent(plugin_class).addClass('disable');
        else
            this.parent(plugin_class).removeClass('disable');
    };

	initCoolform = function(){
		$(function(){
			// Подключаем стили
			var link = document.createElement('link');
			link.href='/bitrix/templates/msu/css/libs/coolform.css';
			link.rel='stylesheet';
			document.getElementsByTagName('head')[0].appendChild(link);
	
			changeCoolformWrappers = function(){
				// Правим обертки
				$(plugin_class + ' input').each(function(){
					switch( $(this).attr('type') ) {
						case 'checkbox':
							$(this).parent(plugin_class).addClass('checkbox');
							break;
						case 'radio':
							$(this).parent(plugin_class).addClass('radio');
							break;
					}
				});
			}
	
			synchronizeCoolform = function(){
				// Синхронизируем классы оберток с состоянием по умолчанию у инпутов
				$(plugin_class + ' input').each(function(){
					if ($(this).is(':checked'))
						$(this).parent(plugin_class).addClass('active');
	
					if ($(this).is(':disabled'))
						$(this).parent(plugin_class).addClass('disable');
				});
			}
	
			changeCoolformWrappers();
			synchronizeCoolform();
	
	
			// Обновляем состояние
			$(plugin_class + ' input').change(function(){
				$(this).refresh();
			});
	
			// Навигация
			$(plugin_class + ' input').focus(function(){
				$(this).parent(plugin_class).toggleClass('focus');
			});
			$(plugin_class + ' input').blur(function(){
				$(this).parent(plugin_class).toggleClass('focus');
			});
		});
	}
	initCoolform();

})( jQuery );



